import React, { Component } from "react";

class Ingredient extends Component {
  constructor(props) {
    super(props);
    this.state = {};
    console.log(props.html);
  }

  render() {
    return (
      <div className="ingredient">
        <div>{this.props.name}</div>
        <div>
          <img src={props.html} />
        </div>
      </div>
    );
  }
}

export default Ingredient;
